import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {

  return (

    <nav>
      <h3>Logo</h3>
      <ul className="nav-links">
        <Link to='/pollination'>
        <li>Graphs</li>
        </Link>
        <Link to='map'>
        <li>Map</li>
        </Link>
      </ul>
    </nav>
  );
}
export default Nav;
